import React from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { Footer } from '../Footer';
import CustomerPurchaseCoupon from './CustomerPurchaseCoupon';
import GetCustomerCoupons from './GetCustomerCoupons';
import GetCustomerCouponsByCategory from './GetCustomerCouponsByCategory';
import GetCustomerCouponsByMaxPrice from './GetCustomerCouponsByMaxPrice';
import GetCustomerDetails from './GetCustomerDetails';
import { NavBarCustomer } from './NavBarCustomer';
interface Props {
  token: string;
  id: number | undefined
}

export const HomeCustomer = (props: Props) => {
  return (
    <div className="HomeAdmin">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<NavBarCustomer />} />
          <Route path='/customer/coupons' element={<GetCustomerCoupons token={props.token} id={props.id} />} />
          <Route path='/updateCoupon' element={<GetCustomerCouponsByCategory token={props.token} id={props.id} />} />
          <Route path='/customer/coupons/maxPrice' element={<GetCustomerCouponsByMaxPrice token={props.token} id={props.id} />} />
          <Route path='/deleteCoupon' element={<GetCustomerDetails token={props.token} id={props.id} />} />
          <Route path='/getCoupons/category' element={<CustomerPurchaseCoupon token={props.token} id={props.id} />} />
        </Routes>
      </BrowserRouter>
      <Footer />
    </div>
  )
}
